import "../assets/css/galeria.css";
import Heart from "./Heart";
import { useContext } from "react";
import context from "../my_context.js";

export default function Home() {
  
  const {photos, sePhotos} = useContext(context);
  
  const handleOnClick = (e) => {
    console.log(e)
  }

  return (
    <div className="galeria grid-columns-5 p-3">
        {
          photos.map(photo =>(
            <div className="foto" id={photo.id} key={photo.id} style={{backgroundImage:`url(${photo.src.medium})`}} onClick={handleOnClick} >
              <Heart filled={photo.liked}/>
              <p>{photo.alt}</p>
            </div>
          ))
        }
    </div>
  );
}
